textOriginal:
Prlo amor de Deus! Ninguem vê que parece tudo proposital? Sendo que nao precisava de nada de guerras? Nunca mais? Olhem... Crisómalo era o referido em Dan 7:13. Muito se perdeu, mas podia ser recuperado. Inclusive historias que influenciou Cristo. 
Crisómalo era equivalente à Jesus para sua época. "Tbm era nosso senhor" e foi sacrificado na região que hoje é a Ucrania. Não podia todo mundo parar pra ver os sinais? Aquilo era um aviso. 
- ou existe algum grupo secreto no meio de nós interferindo em nossos destinos;
- ou existe um viajente do tempo;
- ou Deus realmente existe e Jesus vai aparecer a qualquer momento. 

Seja o que for, mesmo apenas olhando os fatos da atualidade, se escolhermos errado, será o fim.
